  false,\n\t\"url\": null,\n\t\"notes\": \"Terrain data, as defined in FEMA Guidelines
  and Specifications, Appendix N: Data Capture Standards, describe the digital topographic
  data that were used to create the elevation data representing the terrain environment
  of a watershed and/or floodplain. Terrain data requirements allow for flexibility
  in the types of information provided as sources used to produce final terrain deliverables.
  Once this type of data is provided, FEMA will be able to account for the origins
  of the flood study elevation data. NOAA OCM received a delivery from the FEMA Engineering
  Library which included a point shapefile filled with bare-earth points for the 2005
  collection of Ulster County. Within this project was a .ASC DTM file which covered
  a larger area than the footprint of the shapefile. Ultimately, the smaller footprint
  was assumed to be validated bare-earth points and processed for public download
  through the Digital Coast. Final deliverables date to 2007 and cannot be assumed
  to meet later standards and specifications. Although data review suggests a DEM/DTM
  product would suffice as the vertical accuracy was tested thoroughly. Be advised
  that only portions of Ulster County were delivered and OCM is uncertain if more
  verified and classified data exist.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
